('http://www2.blogger.com/profile/08353867386288869384', 'Entebbe', NULL, 'Uganda', NULL, 'To exist for as long as possible while living', '? Blog trotting and finding a new blogger I did not know about who is so good, I can hardly wait to link them to my own blog ? Photography, taking and looking at photos others have taken. Spontaneous photos especially hold me. ? Movies. Once it was Hollywood, a few still come out and surprise me. But more now, I find African movies fascinating. I love their accidental inventiveness, the filmmakers who dare to be sexy and project an image of their Africa as they see it, not as some manual says they should. ? Politics and change agents. Politics, because it determines everything in Uganda, whether we admit it or not; and change agents, because there are lots of courageous souls who opt to stay, try and make a meaningful difference in a few lives, never counting whether anyone else thinks it is significant or not. ? Ugandan and African History, oh yes. I need to know more. Africa in the world, not as the sick continent, not through UN reports prisms, just Africa in the world through African eyes. ? The internet, duh! And the people on it changing my everyday reality.', '[Testing, Testes, Brain, Heart, Timing]', NULL, NULL, NULL, ''),
