('http://draft.blogger.com/profile/05718734832252644370', 'Sassuolo', 'Modena', 'Italy', 'Female', 'Laureata in Tecniche Erboristiche presso l''Università degli Studi di Modena e Reggio Emilia', 'Studio storia medievale per conto mio e ho voluto aprire questo sito, gratuito, al fine di permettere a tutti coloro che hanno curiosità o pregiudizi sul periodo di trovare delle risposte. Ho inoltre messo a disposizione dell''utenza il servizio "Il medievalista risponde" per permettere a chi ha delle domande e delle curiosità di avere anche delle risposte. Premetto e preciso che non sono laureata in storia medievale e il mio corso di studi universitario è sul piano scientifico. Ho iniziato a fare costumi medievali per avere la possibilità di vedere e toccare con mano qualcosa di unico e storico, non solo, anche per studiare e capire il costume medievale. Non faccio costumi per terzi, ma il mio è solo un hobby. Tiro con l''arco a livello non agonistico, mi piacerebbe provare la scherma e amo i misteri.', '[Species, Silicon]', NULL, NULL, NULL, ''),
