('http://www2.blogger.com/profile/04102316668340618248', NULL, NULL, NULL, NULL, NULL, 'I want to thank you for visiting this page. I hope that you will find the information useful and relevant. My goal here is to make the real estate experience much easier by providing you with a wealth of information that you''re probably too busy to do on your own. I''d like this to be a forum where folks can share their knowledge and I happily invite consumers and industry folks alike to use this page. I guess you can say that I''m a real estate hobbyist. I''ve made some money in the field and like to keep track of what''s going on in that market. I''m not one to rush to the stock market section of the newspaper but the real estate sections are always next to my cup of coffee. I''m a researcher by trade so if there''s something you''d like to know more about just let me know and I''ll do what I can to present you with a clear answer from a wide variety of sources. I look forward to hearing from you. I work in business development now, but my interest in real estate started with a job I had several years ago. I worked as the VP of Marketing for an international real estate consortium that handled a variety of residential and commercial entities. I worked in a state that required all principals in an office to carry an active real estate license, so I''ve done the licensure. I''ve never worked as a real estate agent, and have no plans to ever do that. But as someone who deals with the backbone of businesses, I''m constantly amazed at the gaps in service in this field. Posting this forum is my attempt to fill some of those knowledge gaps, with both consumers and people in the industry. For the record, I RESERVE ALL RIGHTS TO THE CONTENT HEREIN. I encourage you to pass along any information that you find helpful, but NO PART OF THIS WEBPAGE OR ITS CONTENT MAY BE REPRODUCED IN ANY MANNER. PLAGIARISM WILL BE RESOLVED WITHIN THE FULLEST EXTENT OF THE LAW.', '[]', NULL, NULL, NULL, ''),
