('http://www2.blogger.com/profile/18212131199189570473', NULL, NULL, 'Portugal', NULL, NULL, 'O Clube 4.ª Dimensão é um clube de política e não, obviamente, de esoterismo ou de geometria no espaço. Há duas maneiras de conceber a 4.ª dimensão: Por uma lado, como se sabe, a 4.ª dimensão é o Tempo. A política anda muito imediatista, ao sabor da maré. É preciso introduzir o Tempo na Política. Quer dando à acção política uma dimensão histórica, quer imbuindo-o de uma perspectiva de Futuro: que também é tempo. Mas, para além do Tempo, que queremos inspire, com raízes e asas, a nossa acção, há outra interpretação para o nome do Clube: Na linguagem técnico-cientítica, a 4.ª dimensão é dita só 4 D. E aí imperativo se torna recordar os 3 "D"s da Revolução de Abril: "Democratizar, Descolonizar, Desenvolver". Na verdade, qualquer dos três D''s, no sentido mais lato, está ainda incompleto. Daí a actualidade de o Clube se interessar pelos três. E qual é o quarto D? O 4 D está em aberto. É o que falta sempre a todas as utopias. Pode ser Dinamizar, e o Clube vem para isso. Pode ser Dignificar, e o Clube gostaria de contribuir para isso. Pode ser Diversificar. E o Clube já é disso manifestação. O Clube 4 D''s será o D em aberto: será aquilo que fizer, com a participação de todos os que aderirem à sua proposta aberta.', '[Cultural development, Sodium, Socialism]', NULL, NULL, NULL, ''),
